import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import { useState } from "react";
import Projects from "./Projects";
import Blog from "./Blog";
import SocialMedia from "./SocialMedia";
import Services from "./Services";
import About from "./About";
import Homepage from "./Homepage";

// Inline styles for quick integration
const styles = {
  app: {
    display: "flex",
    height: "100vh",
    flexDirection: "column",
  },
  header: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    padding: "10px 20px",
    backgroundColor: "#ffffff",
    borderBottom: "1px solid #070505",
    position: "relative",
  },
  logo: {
    height: "150px",
    width: "auto",
    marginRight: "2px",
    position: "absolute", // Fix the logo position
    top: "10px", // Adjust as needed
    left: "10px", // Adjust as needed
  },
  navLinks: {
    listStyle: "none",
    display: "flex",
    margin: 0,
    padding: 0,
  },
  navItem: {
    marginLeft: "20px",
  },
  navLink: {
    textDecoration: "none",
    color: "#fff",  // White color for text in the dropdown
    fontSize: "16px",
    padding: "10px",
  },
  mainContent: {
    flex: 1,
    padding: "20px",
    overflow: "auto",
  },
  // Styles for dropdown menu and button (for small screens)
  dropdownButton: {
    display: "none",  // Hidden by default
    color: "#333",
    fontSize: "24px",
    padding: "10px",
    cursor: "pointer",
    border: "none",
    backgroundColor: "transparent",  // Transparent background
  },
  dropdownMenu: {
    listStyle: "none",
    backgroundColor: "black",
    padding: "10px 0",
    margin: 0,
    display: "none",  // Hidden by default
    flexDirection: "column",
    position: "absolute",  // Ensure it overlays the page
    top: "0",
    left: "0",
    right: "0",
    bottom: "0",
    zIndex: "1000",  // To ensure it stays above other content
  },
  dropdownMenuOpen: {
    display: "flex",  // Show menu when open
  },
  dropdownMenuItem: {
    margin: "10px 0",
  },
  // Media Query for Responsive Design
  mediaQuery: {
    "@media (max-width: 768px)": {
      navLinks: {
        display: "none",  // Hide links by default on small screens
      },
      dropdownButton: {
        display: "block", // Show dropdown button on small screens
      },
      dropdownMenu: {
        display: "none",  // Hidden by default on small screens
      },
    },
  },
};

function App() {
  const [isOpen, setIsOpen] = useState(false);

  // Toggle the dropdown menu
  const toggleNav = () => setIsOpen(!isOpen);

  return (
    <Router>
      <div style={styles.app}>
        <header style={styles.header}>
          <div>
            <Link to="/">
              <img
                src="/starlightlogo.png"
                alt="Starlight Technology Logo"
                style={styles.logo}
              />
            </Link>
          </div>
          <nav>
            {/* Dropdown button for small screens */}
            <div
              style={{
                ...styles.dropdownButton,
                ...(window.innerWidth <= 768 ? styles.mediaQuery["@media (max-width: 768px)"].dropdownButton : {}),
              }}
              onClick={toggleNav}
            >
              {isOpen ? "âˆ’" : "+"}
            </div>

            {/* Navigation links */}
            <ul
              style={{
                ...styles.navLinks,
                ...(window.innerWidth <= 768 ? styles.dropdownMenu : {}),
                ...(isOpen ? styles.dropdownMenuOpen : {}),
              }}
            >
              <li style={styles.navItem}>
                <Link to="/projects" style={styles.navLink}>
                  Projects
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/blog" style={styles.navLink}>
                  Blog
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/social-media" style={styles.navLink}>
                  Social Media
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/services" style={styles.navLink}>
                  Services
                </Link>
              </li>
              <li style={styles.navItem}>
                <Link to="/about" style={styles.navLink}>
                  About
                </Link>
              </li>
            </ul>
          </nav>
        </header>

        <div style={styles.mainContent}>
          <Routes>
            <Route path="/" element={<Homepage />} />
            <Route path="/projects" element={<Projects />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/social-media" element={<SocialMedia />} />
            <Route path="/services" element={<Services />} />
            <Route path="/about" element={<About />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
